import React, { Fragment } from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { BrowserRouter, Route, Redirect } from "react-router-dom";
import { useCookies } from 'react-cookie';
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/App.css';
import routes from './conf/routes';

function App() {

    return (
        <BrowserRouter>
        <Navbar bg="blue">

            <Nav defaultActiveKey="/home" className="ms-auto">
                {true ?
                    <Fragment>
                        <Nav.Item >
                            <Nav.Link href="/login">Home</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/trends">Trends</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/report">Reports</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/evidence">Evidence</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/witness">Witness Statements</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/home">Logout</Nav.Link>               
                        </Nav.Item>
                    </Fragment>
                : 
                    <Fragment>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Login</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/home">Home</Nav.Link>               
                        </Nav.Item>
                    </Fragment>
                }               
            </Nav> 
            </Navbar>
            <Fragment>
                {routes.map( ({ path, component, name}) => {
                    return <Route exact path={path} key={name} component={component} />
                })}
            </Fragment>

        </BrowserRouter>
    );
}

export default App;
